import React from 'react';
import './App.css';

function Board() {
  let table = []
  let idNumber = 0;

  for(let i=1; i<=3; i++){
    let row = []

      for(let j=1; j<=3; j++){
        row.push(<div 
          className='square' id={this.idNumber++}>{j}</div>)
      };

    table.push(<div className='board-row'id={i}>{row}</div>)
  }
  console.log(table)
  return table;
};

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Board/>
      </header>
    </div>
  );
}

export default App;
